import React from 'react';
import PropTypes from 'prop-types';

// import CollegeData from '../colleges.json';

function Card() {
  const { collegeName } = this.props;
  return (
    <div>
      <h1>Helllo</h1>
      collegeName
    </div>
  );
}

Card.propTypes = {
  collegeName: PropTypes.string,
};

Card.defaultProps = {
  collegeName: 'College',
};

export default Card;
